import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div>
      <ul>
        <li>
          <Link to="/">products</Link>
          <Link to="/add">Add Products</Link>
          <Link to="/update">Update Products</Link>
          <Link to="/logout">Logout</Link>
          <Link to="/logout">Logout</Link>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
